&lt;b>Сравнение версий &lt;a  href="http://78.46.73.113/wiki/wakka.php?wakka=AmbsCardsManual/CardsActiveCalls&amp;amp;v=1165" class="">/Ambs&amp;nbsp;Cards&amp;nbsp;Manual&amp;nbsp;/&amp;nbsp;Cards&amp;nbsp;Active&amp;nbsp;Calls&lt;/a> за &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=AmbsCardsManual/CardsActiveCalls&amp;amp;time=2007-09-07+12%3A50%3A20">2007-09-07 12:50:20&lt;/a> и &lt;a href="http://78.46.73.113/wiki/wakka.php?wakka=AmbsCardsManual/CardsActiveCalls&amp;amp;time=2007-09-07+13%3A36%3A26">2007-09-07 13:36:26&lt;/a>&lt;/b>&lt;br />
&lt;br />
&lt;b>Добавлено:&lt;/b>&lt;br />
&lt;div class="additions">||**Type**|
Тип&amp;nbsp;активных звонков. Может принимать значения: &lt;!--notypo-->VoIP&lt;!--/notypo--> или&amp;nbsp;Dial-up (при условии, что&amp;nbsp;установлен диал-ап модуль &lt;!--notypo-->IP Studio AMBS&lt;!--/notypo-->).
||&lt;br />
||**Enter session ID**|
Позволяет сбросить идентификационный номер сессии, под&amp;nbsp;которой звонок проходит в&amp;nbsp;системе.
||&lt;br />
||**Session ID**|
Идентификационный номер сессии, под&amp;nbsp;которой звонок проходит в&amp;nbsp;системе. С&amp;nbsp;помощью этого номера пользователь может сбросить сессию. 
||&lt;br />
||**&lt;!--notypo-->Conf ID&lt;!--/notypo-->**|
Идентификатор звонка, под&amp;nbsp;которым он&amp;nbsp;проходит через оборудование карточной платформы.
||&lt;br />
||**Start time**|
Время начала сессии разговора.
||&lt;br />
||**ANI**|
Номер звонящего абонента.
||&lt;br />
||**PIN**|
Пин-код, который использовался для&amp;nbsp;звонка.
||&lt;br />
||**Card number**|
Номер карты, через которую проходит звонок.
||&lt;br />
||**Destination**|
Номер вызываемого абонента.
||&lt;/div>&lt;/div>
</description>
